import React, { Component } from 'react';
import './NaviMenu.css';

class NaviMenu extends Component{
  render(){
    return (
      <div className="NaviMenu">
        <div className = "GitathonLogo">
          <showLogo logoPath = {this.props.gitathonLogo} />
          console.log(this.props.gitathonLogo)
        </div>
        <div className = "UserName">
          <welcome name = {this.props.userName}/>
        </div>
        <div className = "HackathonLogo">
          <showLogo logoPath = {this.props.hackathonLogo} />
        </div>
        <div className = "profileLogo">
          <showLogo logoPath = {this.props.profileLogo} />
        </div>
      </div>
    );
  }
}

function welcome({name}){
  return(
    <span className = "Welcoming">
      <font color = "purple">{name} </font> 님 환영합니다!!
    </span>
  )
}

function showLogo({logoPath}) {
    return(
      <img src = {logoPath} className = "Movie__Poster" />
    )
}

export default NaviMenu;
